import { useState, useEffect } from 'react';

export default function Navbar() {
    const [stickyClass, setStickyClass] = useState('relative');
  
    useEffect(() => {
      window.addEventListener('.navbar', stickNavbar);
  
      return () => {
        window.removeEventListener('.navbar', stickNavbar);
      };
    }, []);
  
    const stickNavbar = () => {
      if (window !== undefined) {
        let windowHeight = window.scrollY;
        windowHeight > 500 ? setStickyClass('fixed top-0 left-0 z-50') : setStickyClass('.sticky');
      }
    };
  }
